
// Service worker - This is going to work its magic

//Just a random variable to see difference in updates
let version = Math.floor((Math.random() * 100) + 1);

self.addEventListener('install', function(e) {
  console.log('service-worker v%s installed at ', version, new Date().toLocaleTimeString())
  self.skipWaiting()
})

self.addEventListener('activate', function(e) {
  console.log('service-worker v%s activated at ', version, new Date().toLocaleTimeString())
})

self.addEventListener('fetch', function(e) {
  if(!navigator.onLine) {
    e.respondWith(new Response('<!DOCTYPE html> <html> <head> <meta charset="UTF-8"> <meta name="viewport" content="width=device-width, initial-scale=1.0"> <meta http-equiv="X-UA-Compatible" content="ie=edge"> <title>Service worker demo - no service</title> </head> <body style="background-color: #ededed;font-family: Montserrat, \'Open Sans\', Helvetica, Arial, sans-serif;"> <section style="text-align:center;"> <h1 style="display:block;width:100%;padding:20px 0 30px;">Out of Service :( </h1><img style="max-width:200px:" alt="cathat" src="data:image/jpeg;base64,"></section></body></html>', { headers: { 'Content-type': 'text/html' } }))
  } else {
    console.log(e.request.url)
    e.respondWith(fetch(e.request))
  }
})